      _SWEmsgAry["IDS_BHC_QFE314312"] = "\u0645\u0637\u0644\u0648\u0628 \u0627\u0633\u062A\u062E\u062F\u0627\u0645 \u0627\u0644\u0625\u0635\u062F\u0627\u0631 Q314312 \u0623\u0648 \u0627\u0644\u0623\u062D\u062F\u062B \u0645\u0639 \u0627\u0644\u0628\u064A\u0626\u0627\u062A \u0627\u0644\u062A\u064A \u062A\u0633\u062A\u062E\u062F\u0645 \u0645\u062D\u0631\u0631\u0627\u062A \u0623\u0633\u0644\u0648\u0628 \u0627\u0644\u0625\u062F\u062E\u0627\u0644 \u0645\u0639 \u0627\u0644\u0644\u063A\u0627\u062A \u0627\u0644\u0634\u0631\u0642\u064A\u0629 \u0641\u0642\u0637 (\u0643\u0627\u0644\u064A\u0627\u0628\u0627\u0646\u064A\u0629 \u0639\u0644\u0649 \u0633\u0628\u064A\u0644 \u0627\u0644\u0645\u062B\u0627\u0644) \u0639\u0644\u0649 Internet Explorer 5.5. \u062A\u0648\u0641\u0631 Microsoft \u0647\u0630\u0627 \u0627\u0644\u062A\u0635\u062D\u064A\u062D \u0648\u0627\u0644\u0645\u0639\u0644\u0648\u0645\u0627\u062A \u0627\u0644\u0645\u0631\u062A\u0628\u0637\u0629 \u0628\u0647 \u0645\u0646 \u062E\u0644\u0627\u0644 \u0647\u064A\u0626\u0629 \u0627\u0644\u062F\u0639\u0645 \u0627\u0644\u062E\u0627\u0635\u0629 \u0628\u0647\u0627 \u0648/\u0623\u0648 \u0627\u0644\u0627\u0631\u062A\u0628\u0627\u0637 \u0627\u0644\u062A\u0627\u0644\u064A: http://support.microsoft.com/default.aspx?scid=kb;EN-US;Q314312.";
